import React from 'react';

const CartSectionProduct = cartProducts => {
  console.log(cartProducts);
  return (
    <li className="list-group-item d-flex justify-content-between lh-condensed">
          <div>
            <h6 className="my-0">{cartProducts.title}</h6>
            <small className="text-muted">{cartProducts.style}</small>
          </div>
          <span className="text-muted">{cartProducts.price}</span>
      </li>
  )
}

export default CartSectionProduct;
